    rot_period=(9+(56/60))*3600
    dipole_offset=10 #doesnt do anything yet
    g = 24.79 #graviational acceleration
    
    #combine to read out
    consts=[radius,mass_planet,b0,rot_period,dipole_offset,g]
    
    #unpack physical constants from 1Dsinglefieldline
    m_e = phys_consts[0]
    m_p = phys_consts[1]
    k_b = phys_consts[2]
